import React from 'react';
import { Link } from 'react-router-dom';
import { Icon } from '../icon.js';

const Sidebar = () => {
    return (
        <div className='w-[244px] h-full p-3 border-r border-[#dbdbdb]'>
            <Link to="/" className='h-[92px] w-full flex items-center px-3'>
                <img src='/img/logo.svg' className='w-[103px] h-[29px]' alt='' />
            </Link>
            <Link to="#" className='px-3 py-3 rounded-3xl duration-150 ease-linear flex items-center text-link gap-x-4 font-normal hover:!bg-linkHover'>
                <Icon name="home" />
                <span>Ana Sayfa</span>
            </Link>
        </div>
    );
};

export default Sidebar;
